import React from 'react'

export default function Header() {
  return (
    <nav>
      <ul>
        <li>Ifa Brand</li>
        <li>Work</li>
        <li>Shop</li>
        <li>Contact</li>
      </ul>
      <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }
        h1,
        a {
          font-family: 'Roboto', sans-serif;
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </nav>
  )
}
